{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/royanki/bellabeat-case-study-r?scriptVersionId=162886727\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"48f59e0e","metadata":{"papermill":{"duration":0.015927,"end_time":"2024-02-14T19:20:18.430477","exception":false,"start_time":"2024-02-14T19:20:18.41455","status":"completed"},"tags":[]},"source":["## Bellabeat Case Study\n","\n","Bellabeat is a small successful high-tech smart device company that manufactures of health-focused products for women. Bellabeat products are geared to help women achieve fitness goals towards better health. \n","\n","The products of the company can be found [here](https://bellabeat.com/shop/).\n","\n","![](https://sp-ao.shortpixel.ai/client/to_webp,q_lossy,ret_img,w_499/https://smartclothinglab.com/wp-content/uploads/2018/10/bellabeat-smart-jewelry.png)"]},{"cell_type":"markdown","id":"37a327d8","metadata":{"papermill":{"duration":0.015269,"end_time":"2024-02-14T19:20:18.460764","exception":false,"start_time":"2024-02-14T19:20:18.445495","status":"completed"},"tags":[]},"source":["Summary of their products are given below:\n","\n","* Bellabeat app: The Bellbeat app is a web portal connected to all the Bellabeat devices ( Leaf, Time and Spring ) that helps women seek achievable healthy goals by storing health data related to their activity, sleep, stress, menstrual cycle and mindfulness habits. The app helps women understand their current trends and make critical decisions towards a healthier life.\n","\n","* Leaf: Leaf comes as trendy tracker worn as a bracelet, necklace or a clip which connects to the Bellabeat app to monitor daily activity, sleep pattern and stress.\n","\n","* Time: Time is a wellness watch which comes as a classic timepiece with integrated smart technology that monitors activity, sleep pattern and stress.\n","\n","* Spring: Staying hydrated is key in maintaining proper bodily functions. Spring is a smart water bottle that tracks daily water intake via the Bellabeat app.\n","\n","* Bellabeat membership: Bellabeat also offers a subscription-based membership that gives users 24/7 access to fully personalized guidance on nutrition, activity, sleep, health and beauty, and mindfulness based on users lifestyle and goals.\n"]},{"cell_type":"markdown","id":"761223fa","metadata":{"papermill":{"duration":0.015015,"end_time":"2024-02-14T19:20:18.490661","exception":false,"start_time":"2024-02-14T19:20:18.475646","status":"completed"},"tags":[]},"source":["#### Key Stakeholders-\n","\n","* Bellabeat’s cofounder and Chief Creative Officer: **Urška Sršen**\n","* Mathematician and Bellabeat’s cofounder: **Sando Mur**\n","* Bellabeat marketing analytics team\n"]},{"cell_type":"markdown","id":"6622d658","metadata":{"execution":{"iopub.execute_input":"2023-03-12T17:13:29.925311Z","iopub.status.busy":"2023-03-12T17:13:29.923784Z","iopub.status.idle":"2023-03-12T17:13:29.936464Z"},"papermill":{"duration":0.016743,"end_time":"2024-02-14T19:20:18.522865","exception":false,"start_time":"2024-02-14T19:20:18.506122","status":"completed"},"tags":[]},"source":["#### Business Task-\n","\n","Bellabeat is a small successful fitness company that has the great potential to become a larger player in the global fitness tracker market. Analysis of smart device fitness data (Fitbit) in the context of one of Bellabeat's product (Leaf) will be used to generate meaningful insights that will guide the marketing strategy of the Bellabeat product.\n"]},{"cell_type":"markdown","id":"b3662ca5","metadata":{"papermill":{"duration":0.015811,"end_time":"2024-02-14T19:20:18.554198","exception":false,"start_time":"2024-02-14T19:20:18.538387","status":"completed"},"tags":[]},"source":["#### Data Integrity\n","\n","The Fitbit Tracker Dataset is obtained from [Mobius](https://www.kaggle.com/arashnic).The data is downloadable in .csv format.\n"]},{"cell_type":"markdown","id":"5b9caac4","metadata":{"papermill":{"duration":0.015188,"end_time":"2024-02-14T19:20:18.583991","exception":false,"start_time":"2024-02-14T19:20:18.568803","status":"completed"},"tags":[]},"source":["#### Setting the enviornment\n","\n","Setting up the environment by loading `tidyverse`, `dplyr`, `readr`,`tidyr`,`janitor`, `lubridate`, `ggplot2` and `GGally` packages.\n"]},{"cell_type":"code","execution_count":1,"id":"271f71ee","metadata":{"execution":{"iopub.execute_input":"2024-02-14T19:20:18.620916Z","iopub.status.busy":"2024-02-14T19:20:18.618088Z","iopub.status.idle":"2024-02-14T19:20:20.360166Z","shell.execute_reply":"2024-02-14T19:20:20.35817Z"},"papermill":{"duration":1.763482,"end_time":"2024-02-14T19:20:20.363107","exception":false,"start_time":"2024-02-14T19:20:18.599625","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.2 ──\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.4.0      \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 1.0.1 \n","\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.8      \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.10\n","\u001b[32m✔\u001b[39m \u001b[34mtidyr  \u001b[39m 1.2.1      \u001b[32m✔\u001b[39m \u001b[34mstringr\u001b[39m 1.5.0 \n","\u001b[32m✔\u001b[39m \u001b[34mreadr  \u001b[39m 2.1.3      \u001b[32m✔\u001b[39m \u001b[34mforcats\u001b[39m 0.5.2 \n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n","\n","Attaching package: ‘janitor’\n","\n","\n","The following objects are masked from ‘package:stats’:\n"