m motivated and on track."]},{"cell_type":"code","execution_count":20,"id":"e1160ace","metadata":{"execution":{"iopub.execute_input":"2024-02-14T19:23:32.612926Z","iopub.status.busy":"2024-02-14T19:23:32.611023Z","iopub.status.idle":"2024-02-14T19:23:33.06418Z","shell.execute_reply":"2024-02-14T19:23:33.061031Z"},"papermill":{"duration":0.503906,"end_time":"2024-02-14T19:23:33.067783","exception":false,"start_time":"2024-02-14T19:23:32.563877","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 21 × 2</caption>\n","<thead>\n","\t<tr><th scope=col>weekday</th><th scope=col>activitytype</th></tr>\n","\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>VeryActiveMinutes   </td><td> 20.05556</td></tr>\n","\t<tr><td>VeryActiveMinutes   </td><td> 23.10833</td></tr>\n","\t<tr><td>VeryActiveMinutes   </td><td> 21.91935</td></tr>\n","\t<tr><td>VeryActiveMinutes   </td><td> 19.98347</td></tr>\n","\t<tr><td>VeryActiveMinutes   </td><td> 19.40816</td></tr>\n","\t<tr><td>VeryActiveMinutes   </td><td> 22.95395</td></tr>\n","\t<tr><td>VeryActiveMinutes   </td><td> 20.78000</td></tr>\n","\t<tr><td>FairlyActiveMinutes </td><td> 12.11111</td></tr>\n","\t<tr><td>FairlyActiveMinutes </td><td> 14.00000</td></tr>\n","\t<tr><td>FairlyActiveMinutes </td><td> 15.20161</td></tr>\n","\t<tr><td>FairlyActiveMinutes </td><td> 14.52893</td></tr>\n","\t<tr><td>FairlyActiveMinutes </td><td> 11.95918</td></tr>\n","\t<tr><td>FairlyActiveMinutes </td><td> 14.33553</td></tr>\n","\t<tr><td>FairlyActiveMinutes </td><td> 13.10000</td></tr>\n","\t<tr><td>LightlyActiveMinutes</td><td>204.19841</td></tr>\n","\t<tr><td>LightlyActiveMinutes</td><td>192.05833</td></tr>\n","\t<tr><td>LightlyActiveMinutes</td><td>207.14516</td></tr>\n","\t<tr><td>LightlyActiveMinutes</td><td>173.97521</td></tr>\n","\t<tr><td>LightlyActiveMinutes</td><td>185.42177</td></tr>\n","\t<tr><td>LightlyActiveMinutes