)\n","hourly_steps$time <- format(hourly_steps$ActivityHour, format = \"%H:%M:%S\")\n","hourly_steps$date <- format(hourly_steps$ActivityHour, format = \"%m/%d/%y\")\n","n_distinct(hourly_steps$Id)\n","\n","steps <- hourly_steps %>%\n","  group_by(time) %>%\n","  drop_na() %>%\n","  summarise(mean_total_steps = mean(StepTotal))\n","\n","ggplot(data=steps, aes(x=time, y=mean_total_steps)) + geom_histogram(stat = \"identity\",binwidth=3, fill=\"#69b3a2\", color=\"#e9ecef\", alpha=0.9) +\n","  theme(axis.text.x =element_text(angle = 45)) +\n","  labs(title=\"Hourly Steps vs. Time(hrs)\")\n","options(repr.plot.width = 14, repr.plot.height = 12)"]},{"cell_type":"markdown","id":"b9926859","metadata":{"papermill":{"duration":0.050925,"end_time":"2024-02-14T19:23:34.911872","exception":false,"start_time":"2024-02-14T19:23:34.860947","status":"completed"},"tags":[]},"source":["Steps walked overtime during the day peaks between 11am to 5 pm. Activity decreases after dinner. However the famous quote \"after supper walk a mile\" can be used as a motivational message in the app to help some users attain their goal. In a very recent [study]( https://pubmed.ncbi.nlm.nih.gov/36715875/), after meal walk/light exercise has shown to have a strong health benefit.  "]},{"cell_type":"markdown","id":"a1038025","metadata":{"papermill":{"duration":0.049093,"end_time":"2024-02-14T19:23:35.011661","exception":false,"start_time":"2024-02-14T19:23:34.962568","status":"completed"},"tags":[]},"source":["## Ideas for Bellabeat tracker \n","\n","1. The Fitbit analysis shows that easily digestable daily and hourly trends might motivate users to set goals and lead a healthy life. \n","\n","2. For women users, tracker details about menstrual cycle should be included to help women understand how to optimize their fitness activity around the [cycle days](https://link.springer.com/article/10.2165/00007256-200333110-00004). \n","\n","3. Wearing the fitness tracker always is essential. Women would prefer light weight trendy fitness trackers, thus design should be an important way to market the product (as Bellabeat has successfully done!). Based on the Fitbit data it appears that proper syncing of multiple devices to apps in a phone/ computer should be easy. \n","\n","4. Tracking meals (to measure calorie intake), Water intake, Meditation time  and Mindfulness activity might help to make the tracker more complete in generating all the analysis visuals that will help to motivate users. Happiness is a results of endorphin release that results from exercising/walking. Tracking happiness and stress levels might also become an important readout that will help market the product efficiently. \n","\n","5. Improving a product depends very much on feedback from the user community, there should be user friendly feedback mechanism incorporated in the app.\n","\n"]},{"cell_type":"markdown","id":"67bf4479","metadata":{"papermill":{"duration":0.050211,"end_time":"2024-02-14T19:23:35.115653","exception":false,"start_time":"2024-02-14T19:23:35.065442","status":"completed"},"tags":[]},"source":["## Marketing Strategy for Bellabeat fitness tracker\n","\n","\n","1. The main marketing strategy as indicated by the analysis of the Fitbit data shows that there is a large segment of users who fall in the sedentary or light active group. Bellabeat tracker can generate user specific plan that can motivate these groups to a more active lifestyle.\n","\n","2. Target audience: As Bellabeat is a women's product, identifying wellness features that motivates women would be the great first step. Incorporating menstrual cycle and incorporating user based optimization of activity plan around the cycle days might be something that women audience might like. \n","\n","3. Content marketing with discounts: Creative way of generating appealing content about the tracker with success stories might be a way to market the product efficiently. Limited time offers, referral programs might help to encourage women to buy the product. Additionally, showcasing the product in fitness events like marathons etc. and even partnering with gyms might help market the product.  \n","\n","4. Social media and brand ambassador: Social medai platforms like Facebook, Instagram etc. can be used to showcase the product. Fitness influencers can also promote the product to reach a larger audience.  \n","\n"]},{"cell_type":"markdown","id":"cc2f22fe","metadata":{"papermill":{"duration":0.050067,"end_time":"2024-02-14T19:23:35.216033","exception":false,"start_time":"2024-02-14T19:23:35.165966","status":"completed"},"tags":[]},"source":["## References\n","\n","1. Effects of the Menstrual Cycle on Exercise Performance Xanne et.al 2012\n","https://link.springer.com/article/10.2165/00007256-200333110-00004\n","\n","2. CDC https://health.gov/sites/default/files/2019-09/Physical_Activity_Guidelines_2nd_edition.pdf\n","\n","3. After Dinner Rest a While, After Supper Walk a Mile? Engeroff et al.2023  https://pubmed.ncbi.nlm.nih.gov/36715875/"]},{"cell_type":"code","execution_count":null,"id":"402aae10","metadata":{"papermill":{"duration":0.04927,"end_time":"2024-02-14T19:23:35.315998","exception":false,"start_time":"2024-02-14T19:23:35.266728","status":"completed"},"tags":[]},"outputs":[],"source":[]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":1041311,"sourceId":1752235,"sourceType":"datasetVersion"}],"dockerImageVersionId":30372,"isGpuEnabled":false,"isInternetEnabled":true,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":201.304876,"end_time":"2024-02-14T19:23:35.996127","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2024-02-14T19:20:14.691251